#include <bits/stdc++.h>
using namespace std;

string solve() {

  int n, m;
  int mx, cur = 1;
  
  scanf("%d%d", &n, &mx);
  
  for (int i = 1; i < n; i++) {
    scanf("%d", &m);
    if (mx < m) {
      mx = m; cur++;
    }
  }
  if (cur % 2) return "Toshmat\n";
  return "Eshmat\n";
}

int main()
{
    int t;
    scanf("%d", &t);
    while (t--) 
      cout << solve();
      
    return 0;
}
